import React, { Component } from 'react';

class PostInline extends Component {
    render() { 
        return (
        <div>
            
            <ul class="list-group">
                <li className="list-group-item active">{this.props.post.name}</li>
                <li className="list-group-item">{this.props.post.price}</li>
                <li className="list-group-item">{this.props.post.quantity}</li><br/><br/>
             </ul>
        </div> 
        );
    }
}
 
export default PostInline;
